import React from "react";
import { useNavigate } from "react-router-dom";
import logo from '../Home/Assets/logo3.jpg'
import '../Header/Header.css'
import '../Home/Assets/Aleg.ttf'


function Header(){
    const navigate1= useNavigate()
    const Home = ()=>{navigate1('/')}

    const navigate2= useNavigate()
    const Facility=()=>{navigate2('/facility')}

    const navigate3= useNavigate()
    const Appointment=()=>{navigate3('/appointment')}

    const navigate4= useNavigate()
    const Admin=()=>{navigate4('/admin')}


    return(
    <div className="nav-sec">
     <header className="nav-head">
       
        <div className="nav-logo" ><img src={logo}></img>
           <h2>Hope Care</h2></div>
     
        <div className="nav-button ">
        
<div><button onClick={Home}><h4>Home</h4></button></div>
<div><button onClick={Facility}><h4>Facility</h4></button></div>
<div><button onClick={Appointment}><h4>Appointment</h4></button></div>
<div><button onClick={Admin}><h4>Admin</h4></button></div>
</div>
</header>
    </div>
    )
}

export default Header
